import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './Login.css';

class Login extends Component {
  render() {
  return (
            <form className="form-group">
                <h3>Connectez-vous</h3>

                <div>
                    <label>Adresse mail</label>
                    <input type="email" className="form-control" placeholder="Saisir email" required />
                </div>

                <div>
                    <label>Mot de passe</label>
                    <input type="password" className="form-control" placeholder="Saisir mot de passe" required />
                </div>

                <div>
                    <div>
                        <input type="checkbox" className="custom-control-input" id="customCheck1" />
                        <label className="custom-control-label" htmlFor="customCheck1">Se souvenir de moi</label>
                    </div>
                </div>

                <button type="submit" className="btn btn-primary">Submit</button>
                <p className="forgot-password">
                    <a href="#">Mot de passe oubli√© ?</a>
                </p>
            </form>
        );
    }
}

export default Login;
